  console.log(user.characters)

  // (user.characters.map(character => <UserCharacterCard key={character.id}/>))

  if (user.characters) {
    setUserCharacterCards(user.characters.map(character => {
      return (
        <UserCharacterCard character={character} setCharacter={setCharacter}/>
      )
    }))
  }

  return (
    <>
    </>
  )
}

export default Account
